	# 在状态机中查找状态，找到则直接返回
	# TODO: 可优化的地方是每旋转一个方向，都可以水平或垂直镜像
	def find_table(self, board):
		b1 = hash_board(board)
		b2 = hash_board(np.flipud(board))
		b3 = hash_board(np.fliplr(board))
		b4 = hash_board(np.rot90(board, 1))
		b5 = hash_board(np.flipud(np.rot90(board, 1)))
		b6 = hash_board(np.fliplr(np.rot90(board, 1)))
		b7 = hash_board(np.rot90(board, 2))
		b8 = hash_board(np.rot90(board, 3))
		for i in TABLE:
			tables = i.keys()
			for j in tables:
				x, y = i[j][0], i[j][1]
				if b1 == j:
					return tuple((x, y))
				# 判断棋盘状态的变式
				elif b2 == j:
					return tuple((self.chessboard_size - x - 1, y))
				elif b3 == j:
					return tuple((x, self.chessboard_size - y - 1))
				elif b4 == j:
					return tuple((self.chessboard_size - y - 1, x))
				elif b5 == j:
					return tuple((y, x))
				elif b6 == j:
					return tuple((self.chessboard_size - y - 1, self.chessboard_size - x - 1))
				elif b7 == j:
					return tuple((self.chessboard_size - x - 1, self.chessboard_size - y - 1))
				elif b8 == j:
					return tuple((y, self.chessboard_size - x - 1))
